	/**
	 * Assign a shipment to the user, the input is Shipment OID number
	 */
	public static void assignShipmentAndValidate(String strShipmentNum) {
		String strBody = "{\r\n" + "    \"shipmentOidList\": [\r\n" + "        \"" + strShipmentNum + "\"\r\n"
				+ "    ],\r\n" + "    \"userInfoList\": [\r\n" + "        {\r\n" + "            \"userID\": \"" + userID
				+ "\",\r\n" + "            \"userNm\": \"" + userName + "\"\r\n" + "        }\r\n" + "    ],\r\n"
				+ "    \"teamLeader\": false\r\n" + "}";
		RequestSpecification request = RestAssured.given();
		request.baseUri(
				environment + "gemini/shipment-competency-action-service/import-shipment-action/assign-to-user");
		Response response = setAssignUnassignShipmentHeaders(request).body(strBody).post();
		System.out.println("**************************************************************");
		System.out.println(response.asString());
		if (response.asString().contains("Shipment Assigned To User Successfully")) {
			System.out.println("Shipment Assigned To User Successfully");
		} else {
			System.out.println("Shipment Not Assigned To User Successfully");
		}
		System.out.println("**************************************************************");
	}

