				+ "        \"type\": \"string\"\r\n" + "    }\r\n" + "}";
		RequestSpecification request = RestAssured.given();
		request.baseUri(environment + "gemini/user-meta-data-service/getTeamWorklistWithUserPreference");
		Response response = setTeamPreferenceHeaders(request).body(strBody).post();
		System.out.println("**************************************************************");
		JsonPath js = new JsonPath(response.asString());
		System.out.println(js.getString("data.rows[3].shipmentOidNbr").toString()); // Get the 3rd record
